import logo from './logo.svg';
import './App.css';
import {Customer} from './Customer';
import {Property} from './Property';
import {Sales} from './Sales';
import { BrowserRouter, NavLink,Switch,Router,Route,Routes} from 'react-router-dom';

function App() {
  return (
    <div className="App container">
   <h3 className='d-flex justify-content-center m-3'>
     React front end
   </h3>

     <nav className='navbar navbar-expand-sm bg-light navbar-dark'>
       <ul className='navbar-nav'>
         <li className='nav-item- m-1'>
          <NavLink className='btn btn-light btn-outline-primary' to='/Customer'>Customer</NavLink>
         </li>
       </ul>     
       <ul className='navbar-nav'>
         <li className='nav-item- m-1'>
          <NavLink className='btn btn-light btn-outline-primary' to='/Customer'>Property</NavLink>
         </li>
       </ul>    
       <ul className='navbar-nav'>
         <li className='nav-item- m-1'>
          <NavLink className='btn btn-light btn-outline-primary' to='/Customer'>Sales</NavLink>
         </li>
       </ul>    
       </nav>
     <Router>
        <Routes>
        <Route path='/home' component={Customer}/>
        <Route path='/property' component={Property}/>
        <Route path='/sales' component={Sales}/>
       </Routes>
    </Router>
      </div>
  );
}

export default App;
